INSERT INTO `suggestions` VALUES (2,7,'Test suggestion','Cross-site scripting (XSS) is a type of computer security vulnerability typically found in Web applications. XSS enables attackers to inject client-side script into Web pages viewed by other users. A cross-site scripting vulnerability may be used by attackers to bypass access controls such as the same origin policy. Cross-site scripting carried out on websites accounted for roughly 84% of all security vulnerabilities documented by Symantec as of 2007.[1] Their effect may range from a petty nuisance to a significant security risk, depending on the sensitivity of the data handled by the vulnerable site and the nature of any security mitigation implemented by the site\'s owner.','2014-05-18 08:06:26','2014-05-27 16:00:02',10),(3,1,'trtata','tekstas','2014-05-23 04:10:38','2014-05-27 16:06:41',0);
